import { useState } from 'react';
import {
    Box,
    Heading,
    Image,
    Table,
    Tbody,
    Td,
    Th,
    Thead,
    Tr,
    Button,
    FormControl,
    FormLabel,
    Input,
    Text
} from '@chakra-ui/react';
import AgeSlider from './AgeSlider';
import { Link as ChakraLink } from "@chakra-ui/react";
import { Link as RouterLink } from "react-router-dom";


function User() {


    const [initalUsers, setInitialUsers] = useState([{
        id: 1,
        firstName: 'default',
        lastName: 'default',
        username: 'default',
        password: 'default',
        profilePic: "",
    }, {
        id: 2,
        firstName: 'joseph',
        lastName: 'vijay',
        username: 'arun',
        password: 'kuruvilla',
        profilePic: null,
    }]);
    const [formData, setFormData] = useState({
        firstName: '',
        lastName: '',
        username: '',
        profilePic: null,
    });

    const [CurrentUserIndex, setCurrentUserIndex] = useState(0)

    function handleFileChange(event) {
        const file = event.target.files[0];
        const reader = new FileReader();
        reader.readAsDataURL(file);
        reader.onload = () => {
            setFormData(prevState => ({
                ...prevState,
                profilePic: reader.result.split(',')[1] // remove data:image/jpeg;base64 from the string
            }));
        };
        reader.onerror = (error) => {

        };
    }

    const handleChange = (event) => {
        // setNewUser({ ...newUser, [event.target.name]: event.target.value });
    };

    const handleInputChange = (event) => {
        const { name, value } = event.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleAddUser = (e) => {
        e.preventDefault(); // prevent the default form submission behavior

        // Convert the profile pic file to a base64 string
        let profilePicBase64 = null;
        // if (formData.profilePic) {
        //     const reader = new FileReader();
        //     reader.readAsDataURL(formData.profilePic);
        //     reader.onload = () => {
        //         profilePicBase64 = reader.result;
        //     };
        // }

        // Append the new user to the initialUsers array
        const newUser = {
            firstName: formData.firstName,
            lastName: formData.lastName,
            username: formData.username,
            password: "default",
            profilePic: formData.profilePic,
            age: formData.age,
        };
        setInitialUsers((prevUsers) => [...prevUsers, newUser]);
        // initalUsers.push(newUser)

        // Clear the form data for next use
        setFormData({
            firstName: "",
            lastName: "",
            username: "",
            profilePic: null,
            age: 18,
        });
    };


    return (
        <Box padding={10}>
            <Box bg="gray.100" rounded="md" p={4} mb={4} align="center">
                <Image //"https://via.placeholder.com/150"
                    id={"user_image"}
                    src={initalUsers[CurrentUserIndex].profilePic ? `data:image/jpeg;base64,${initalUsers[CurrentUserIndex].profilePic}` : "https://via.placeholder.com/150"}
                    alt="Profile Picture"
                    boxSize="200px"
                    objectFit="contain"
                />
                <Heading size="md" mt={4} id={"user_name"}>
                    {initalUsers[CurrentUserIndex].username.toUpperCase()}
                </Heading>
            </Box>

            <Box bg="white" rounded="md" p={4} mb={4}>
                <Text fontSize="lg" fontWeight="bold" color="gray.700"> List of users </Text>
                <Table variant="simple" align="center">
                    <Thead>
                        <Tr>
                            <Th>First Name</Th>
                            <Th>Last Name</Th>
                            <Th>Username</Th>
                            <Th>Password</Th>
                            <Th>Profile Pic</Th>
                            <Th>Change User</Th>
                        </Tr>
                    </Thead>
                    <Tbody>
                        {initalUsers.map((user, index) => (
                            <Tr key={index}>
                                <Td>{user.firstName}</Td>
                                <Td>{user.lastName}</Td>
                                <Td>{user.username}</Td>
                                <Td>{user.password}</Td>
                                <Td>{user.profilePic ? <img

                                    src={`data:image/jpeg;base64,${user.profilePic}`}
                                    style={{ height: "75px", width: "75px" }}
                                    alt="User profile pic" /> : null}</Td>
                                <Td>
                                    <input
                                        type="radio"
                                        name="currentUser"
                                        value={index}
                                        checked={index == CurrentUserIndex}
                                        onChange={(e) => { return true }}
                                        onClick={(e) => {
                                            setCurrentUserIndex(index)
                                        }}
                                    />
                                </Td>
                            </Tr>
                        ))}
                    </Tbody>
                </Table>
            </Box>


            <Box bg="white" rounded="md" p={4}>
                <form onSubmit={handleAddUser}>
                    <FormControl mb={4}>
                        <FormLabel>First Name</FormLabel>
                        <Input
                            type="text"
                            name="firstName"
                            value={formData.firstName}
                            onChange={handleInputChange}
                        />
                    </FormControl>

                    <FormControl mb={4}>
                        <FormLabel>Last Name</FormLabel>
                        <Input
                            type="text"
                            name="lastName"
                            value={formData.lastName}
                            onChange={handleInputChange}
                        />
                    </FormControl>

                    <FormControl mb={4}>
                        <FormLabel>Username</FormLabel>
                        <Input
                            type="text"
                            name="username"
                            value={formData.username}
                            onChange={handleInputChange}
                        />
                    </FormControl>

                    <FormControl mb={4}>
                        <FormLabel>Profile Picture</FormLabel>
                        <Input type="file" accept="image/*" onChange={handleFileChange} />
                    </FormControl>
                    <AgeSlider />

                    <Button type="submit" colorScheme="blue" >
                        Add User
                    </Button>
                </form>
                <Button margin={"10px"} colorScheme='teal' size='sm' onClick={() => { }} id="user_goto_home">
                    <ChakraLink as={RouterLink} to="/">
                        Home
                    </ChakraLink>
                    {/* <Link _hover={{ textDecoration: 'none' }}
                            _visited={{ color: 'white' }} color='teal.500' href='/cart' >
                            <Text textDecoration="none">Go to Cart</Text>
                        </Link> */}

                </Button>
            </Box>

        </Box>
    );
}

export default User;
